INSERT INTO `news` (`id`, `headline`, `link`, `visibility`, `category`, `body`, `image_1`, `created_by`, `time_created`, `date_created`, `hash_id`, `thumbnail`, `notification_status`) VALUES
(2, 'How to Publish your writings on Boardspeck (FREE)', 'Boardspeck', 'show', '8a8ol2G34157b07l', '<p>Publishing your Article on BOARDSPECK is easy.&nbsp;</p><h3>Features:</h3><ul><li><strong>Easy management</strong> (<i>You can easily edit, publish or unpublished your content)</i></li><li><strong>Author\'s profile</strong> (<i>Create author\'s profile where people can have access to your published works)</i></li><li><strong>Easily shareable to social media </strong>(<i>Share to friends on Facebook, LinkedIn, WhatsApp and Twitter)</i></li><li><strong>Peer-to-Peer &nbsp;Critique</strong> (<i>Recieve or send critique/review &nbsp;to other author\'s)</i></li></ul><h3><strong>Step by Step Walk through &nbsp;(Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><h3>Signup</h3><ul><li>Click <a href=\"https://boardspeck.com/signup\"><strong>HERE</strong></a> to signup.</li><li>Tick <strong>Article</strong> as one of your interest.</li><li>Submit and verify your account by visiting the link sent to your registration email.</li></ul><h3>Create Profile</h3><ul><li>Click <a href=\"https://boardspeck.com/addProfile\"><strong>HERE</strong></a> or Click <strong>Edit Profile</strong> on the dashboard, after signing in.</li><li>Add a unique username.</li><li>Add your social media accounts (<i>Leave blank where you don\'t have account with the listed platform)</i></li><li>Add a picture of you. (<i>Passport sized pictures often look good on profile)</i></li><li>Click <strong>Submit</strong></li></ul><h3>Post Your Content</h3><ul><li>Click <a href=\"https://boardspeck.com/addArticle\"><strong>Here</strong></a> or Click <strong>Post Article</strong> on the dashboard</li><li>Enter title of your content</li><li>Enter the content</li><li>Select <strong>YES</strong> or <strong>NO</strong> if you want to add your profile to the particular article as displayed on the page</li><li>Upload a suitable <strong>LANDSCAPE</strong> Image for your content</li><li>Click <strong>Submit</strong>.</li></ul><p>If your posting is successful, you would be redirected to your article.&nbsp;</p><blockquote><p><strong>Please note: </strong>&nbsp;Your article is not visible to the public until you Click <strong>Publish b</strong>utton. For the first 3 articles, It would be published and verified by Boardspeck. After the third content published, you will be able to publish or unpublished your article.</p></blockquote><h3>Manage your Articles</h3><ul><li>To manage your articles. Click <a href=\"https://boardspeck.com/manageArticles\"><strong>HERE</strong></a><strong> </strong>or Click <strong>My Articles</strong> from the dashboard if signed in.</li><li>To edit your article, click the <strong>edit</strong> button.</li><li>To change the Image of a particular article, click the Image.</li><li>Click <strong>Publish</strong> to publish your article.</li><li>Click <strong>Unpublish</strong> to hide an article.(<i>unpublished articles would not show on the BOARDSPECK page and would not be counted as your published content as displayed on author\'s profile.</i></li></ul><blockquote><p>To visit your profile anytime, visit <strong>https://boardspeck.com/b/</strong><i><strong>username</strong> </i>(replace \"username\" with your personal username.</p></blockquote><p>If you need help with anything, chat with us at &nbsp;<a href=\"https://boardspeck.com/help\">https://boardspeck.com/help</a></p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/1540673836424635020181020_133604_0001.png', 'j90819542aBn72i', '20:57:18', '2018-10-27', '154067383837we7hw6o596s62n5', 'thumb/1540673836665652820181020_133604_0001.png', 1),
(3, 'How to Post and Promote Your Training on Boardspeck (FREE)', 'Boardspeck', 'show', 'gia5235e9940N73ir', '<p>Boardspeck offers a training management tool that allows trainers to publish their training on the Boardspeck Application, where prospective trainees can find them.&nbsp;</p><p>&nbsp;</p><p><strong>FEATURES:</strong></p><ul><li><strong>Participants registration</strong> (<i>Prospective participants can register for your training on the Boardspeck Application, you can also add your registration form link to your Training i.e Google Form or a registration form on your website)</i></li><li><strong>Easily shareable to social media </strong>(<i>Share to friends on Facebook, LinkedIn, WhatsApp and Twitter)</i></li><li><strong>Manage participants details</strong> (<i>You can get all registered participants details and you can export data to PDF)</i></li></ul><h3><strong>Step by Step Walk through &nbsp;(Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><h4>Signup</h4><ul><li>Click <a href=\"https://boardspeck.com/signup\"><strong>HERE</strong></a> to signup.</li><li>Tick <strong>Training</strong> as one of your interest.</li><li>Submit and Verify your account by visiting the link sent to your registration email.</li><li>&nbsp;</li></ul><h4>Post Your Training</h4><ul><li>Click <a href=\"https://boardspeck.com/addTraining\"><strong>Here</strong></a> or Click <strong>Post Training</strong> on the dashboard</li><li>Enter the title of your training</li><li>Enter the training details (<i>You can write About the Training </i>)</li><li>Enter organizers name (The name of the business or company organizing the training)</li><li>Enter organizer\'s details (<i>You can write briefly about the organizer. This will also give more insight to your business or company</i>)</li><li>&nbsp;</li></ul><h4>If you want participants to register for your training on Boardspeck, click <strong>SET REGISTRATION</strong></h4><blockquote><p>If you select <strong>SET REGISTRATION,</strong> Boardspeck will provide a registration link and &nbsp;registration form that will collect NAME, PHONE NUMBER and EMAIL for people to register for your training. You will get notification when participants register(Click the Bell button on the bottom right side of this page to enable notification) &nbsp;and you will be able to manage participants registration Information from your Boardspeck Account. &nbsp;</p></blockquote><p>Enter registration closing date (<i>Participants will not be able to register after this date. You can still extend the date later, if you wish</i> )</p><p>Enter registration limit (<i>Participants will not be able to register after the number of people you specified have registered. You can still add more slots later, if you wish</i> )</p><p>&nbsp;</p><h4>If you want participants to register for your training from external link (e.g Google Form Link or your website) Click external link</h4><blockquote><p>If you select <strong>External link, </strong>Your registration will be handled at the destination of the specified link</p></blockquote><ul><li>Enter the external registration link &nbsp;(Ensure you add http or https:// to your link and ensure that it is a working link );</li><li>Select if you want Boardspeck to display you registration link with your training.</li><li>Upload a suitable <strong>LANDSCAPE</strong> Image for your content</li><li>Click <strong>Submit</strong>.</li></ul><p>If your posting is successful, you would be redirected to your Training.&nbsp;</p>', 'uploads/1540738709620513520181010_085654_0001.png', 'j90819542aBn72i', '14:58:31', '2018-10-28', '1540738711ne6s15h266o818ww', 'thumb/1540738709104815420181010_085654_0001.png', 1),
(4, 'How to Post and Promote Your Event on Boardspeck (FREE)', 'Boardspeck', 'show', '7398irnA16fc538a4', '<p>Boardspeck offers event management tools that allows event organizers and individuals to publish and trend their event on the Boardspeck Application, where prospective participants can find them.&nbsp;</p><p>&nbsp;</p><p><strong>FEATURES:</strong></p><ul><li><strong>Participants registration</strong> (<i>Prospective participants can register for your event on the Boardspeck Application, you can also add your registration form link to your Event i.e Google Form or a registration form on your website)</i></li><li><strong>Shareable to social media </strong>(<i>Share to friends on Facebook, LinkedIn, WhatsApp and Twitter)</i></li><li><strong>Manage participants details</strong> (<i>You can get all registered participants details and you can export data to PDF)</i></li><li><strong>Qr Verification</strong> (<i>You can use your android phone to verify your participants into your event)</i></li><li><strong>Manage Attendance</strong> (If you use QR verification for your event, <i>You can get all the details of attendee that you scanned into your event and export the attendance &nbsp;to PDF, hence no need for local registration)</i></li></ul><h3><strong>Step by Step Walk-through (Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><h4>Signup</h4><ul><li>Click <a href=\"https://boardspeck.com/signup\"><strong>HERE</strong></a> to signup.</li><li>Tick <strong>Events</strong> as one of your interest.</li><li>Submit and Verify your account by visiting the link sent to your registration email.</li></ul><h4>Post Your Event</h4><ul><li>Click <a href=\"https://boardspeck.com/addEvent\"><strong>Here</strong></a> or Click <strong>Create Event</strong> on the dashboard</li><li>Enter the name of your Event</li><li>Set &nbsp;the Date for your event of your Event. (<i>if your event is one day event, set start date and end date to same date &nbsp;</i>)</li><li>Enter the time for your Event (i<i>f your &nbsp;event has different time for different days, specify the dates in the event description field </i>)</li><li>Enter the full address of where your event will be taking place</li><li>Enter a short location (<i>E.g Ikeja, Lagos</i>)</li><li>Enter the event description(<i>You can write About the event </i>)</li><li>Enter organizers name (The name of the business,organization or company organizing the event)</li><li>Enter organizer\'s description (<i>You can write briefly about the organizer. This will also give more insight to your business, organize or company</i>)</li></ul><h4>If you want participants to register for your event on Boardspeck, click <strong>SET REGISTRATION</strong></h4><blockquote><p>If you select <strong>SET REGISTRATION,</strong> Boardspeck will provide a registration link and &nbsp;registration form that will collect NAME, PHONE NUMBER and EMAIL for people to register for your event. You will get notification when participants register(Click the Bell button on the bottom right side of this page to enable notification) &nbsp;and you will be able to manage participants registration Information from your Boardspeck Account. &nbsp;</p><p>If you allow QR Verification, A qr code will be generated for your registered participants to download or screenshot. This Qr code is not Transferable(it can only be used by one person at the particular event only).&nbsp;</p></blockquote><ul><li>Enter registration closing date (<i>Participants will not be able to register after this date. You can still extend the date later, if you wish</i>)</li><li>Select if you want Boardspeck to display you registration link with your event.</li><li>Enter registration limit (<i>Participants will not be able to register after the number of people you specified have registered. You can still add more slots later, if you wish</i> ).</li><li>Tick QR Verification if you will like to use &nbsp;android device to scan registered participants in to the event (<i>Any Android device that has a Camera can verify your event, provided your Boardspeck account is logged in to the device. You can login to multiple device to verify your event</i>)</li></ul><h4>If you want participants to register for your event from external link (e.g Google Form Link or your website) Click external link</h4><blockquote><p>If you select <strong>External link, </strong>Your registration will be handled at the destination of the specified link.&nbsp;</p><p><strong>Please Note: You cannot use QR verification or Export Participants Details if you use external registration.</strong></p></blockquote><ul><li>Enter the external registration link &nbsp;(Ensure you add http or https:// to your link and ensure that it is a working link );</li><li>Select if you want Boardspeck to display you registration link with your Event.</li><li>Upload a suitable <strong>LANDSCAPE</strong> Image for your content</li><li>Click <strong>Submit</strong>.</li></ul><p>If your posting is successful, you would be redirected to your Training.&nbsp;</p><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=how-to-manage-the-registered-participants-for-your-event-on-boardspeck-free&amp;id=1540818504n7344we63h9s0w12o\"><strong>How to Manage the Registered Participants for your Event on Boardspeck (FREE)&nbsp;</strong></a></p><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=qr-code-how-to-use-your-android-device-to-scan-registered-participants-at-your-event-on-boardspeck-free&amp;id=15408206176n1r1176e43qs0w3\"><strong>How to use your ANDROID device to Scan Registered Participants at your event on Boardspeck(FREE)</strong></a></p><p>&nbsp;</p>', 'uploads/154081546478940920181009_185625_0001.png', 'j90819542aBn72i', '12:17:46', '2018-10-29', '1540815466nse4811613wo91wh7', 'thumb/1540815464300878520181009_185625_0001.png', 1),
(5, 'How to Manage the Registered Participants for your training on Boardspeck (FREE)', 'Boardspeck', 'show', 'gia5235e9940N73ir', '<p>Boardspeck allows participants to register for your training, while you can manage the data of your registered Participant.</p><p><strong>This article assumes that you have posted your training on Boardspeck and have enabled participant registration.&nbsp;</strong></p><p><strong>If you haven\'t Visit: </strong><a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-training-on-boardspeck-free&amp;id=1540738711ne6s15h266o818ww\"><strong>How to post and promote your training on Boardspeck (FREE)&nbsp;</strong></a></p><h3><strong>Step by Step Walk-through &nbsp;(Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><ul><li>Click <a href=\"https://boardspeck.com/login\"><strong>HERE</strong></a> to Login if you are not logged in.</li><li>Click <strong>My Trainings</strong> to manage your Training</li></ul><blockquote><p>If you select Boardspeck Participants\' Registration while posting your Training. <strong>Registered Participants </strong>button will be available.</p></blockquote><ul><li>Click <strong>Registered Participant</strong></li><li>To get all Numbers of Registered Participants (Click <strong>All Numbers</strong>)</li><li>To get all Emails of Registered Participants (Click <strong>All Email</strong>)</li><li>To get your registration link (Click <strong>My Registration Link</strong>)</li><li>To Export the current list of registered participant (Click <strong>Export to PDF</strong>)</li><li>&nbsp;</li></ul>', 'uploads/1540817601321998620181010_082054_0001.png', 'j90819542aBn72i', '12:53:23', '2018-10-29', '154081760396h9ws6e5w873o1n', 'thumb/1540817601257011620181010_082054_0001.png', 1),
(6, 'How to Manage the Registered Participants for your Event on Boardspeck (FREE)', 'Boardspeck', 'show', '7398irnA16fc538a4', '<p>Boardspeck allows participants to register for your event, while you can manage the data of your registered Participant.</p><p><strong>This article assumes that you have posted your event on Boardspeck and have enabled participant registration.&nbsp;</strong></p><p><strong>If you haven\'t, please visit: </strong><a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-event-on-boardspeck-free&amp;id=1540815466nse4811613wo91wh7\"><strong>How to post and promote your event on Boardspeck (FREE)&nbsp;</strong></a></p><h3><strong>Step by Step Walk-through (Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><ul><li>Click <a href=\"https://boardspeck.com/login\"><strong>HERE</strong></a> to Login if you are not logged in.</li><li>Click <strong>My Events</strong> to manage your Event</li></ul><blockquote><p>If you select Boardspeck Participants\' Registration while posting your Event. <strong>Registered Participants </strong>button will be available.</p></blockquote><ul><li>Click <strong>Registered Participant</strong></li><li>To get all Numbers of Registered Participants (Click <strong>All Numbers</strong>)</li><li>To get all Emails of Registered Participants (Click <strong>All Email</strong>)</li><li>To get your registration link (Click <strong>My Registration Link</strong>)</li><li>To Export the current list of registered participant (Click <strong>Export to PDF</strong>)</li><li>&nbsp;</li></ul><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-event-on-boardspeck-free&amp;id=1540815466nse4811613wo91wh7\"><strong>How to post and promote your event on Boardspeck (FREE)&nbsp;</strong></a></p><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=qr-code-how-to-use-your-android-device-to-scan-registered-participants-at-your-event-on-boardspeck-free&amp;id=15408206176n1r1176e43qs0w3\"><strong>How to use your ANDROID device to Scan Registered Participants at your event on Boardspeck(FREE)</strong></a></p><p>&nbsp;</p>', 'uploads/1540818502802209320181009_185625_0001.png', 'j90819542aBn72i', '13:08:24', '2018-10-29', '1540818504n7344we63h9s0w12o', 'thumb/1540818502249080020181009_185625_0001.png', 1),
(7, 'QR CODE: How to use your ANDROID device to Scan Registered Participants at your event on Boardspeck(FREE)', 'Boardspeck', 'show', '7398irnA16fc538a4', '<p>Boardspeck allows participants to register for your event, while you can manage the data of &nbsp;registered Participant and use your android device to verify registered participants at your event.</p><p><strong>This article assumes that you have posted your event on Boardspeck and have enabled participant registration and QR verification.&nbsp;</strong></p><p><strong>If you haven\'t, please visit: </strong><a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-event-on-boardspeck-free&amp;id=1540815466nse4811613wo91wh7\"><strong>How to post and promote your event on Boardspeck (FREE)&nbsp;</strong></a></p><p><strong>FEATURES:</strong></p><ul><li><strong>Participants QR Code</strong> (If you have ticked <strong>QR verification</strong> while posting your event. Your participants would be given QR code after their registration<i>)</i></li><li><strong>Qr Verification</strong> (<i>You can use your android phone to verify your participants into your event)</i></li><li><strong>Auto Attendance</strong> (<i>You can get all the details of attendee that you scanned into your event and export the attendance &nbsp;to PDF, hence no need for local registration or paper attendance)</i></li></ul><h3><strong>Step by Step Walk-through (Internet access and Best Optimized for Chrome Mobile Browser)</strong></h3><ul><li>Click <a href=\"https://boardspeck.com/login\"><strong>HERE</strong></a> to Login if you are not logged in.</li><li>Click <strong>My Events</strong> to manage your Event</li></ul><blockquote><p>If you enabled QR verification while posting your Event. <strong>Verify Participants </strong>button will be available on the particular event.</p></blockquote><ul><li>Click <strong>Verify Participants</strong></li><li>A prompt may appear to grant access to your device camera. Click <strong>Allow</strong></li><li>A QR scanner will appear.</li><li>Request for participant\'s qr code that was downloaded or Screenshot after Registration</li><li>View the QR code with the QR scanner. A prompt will appear showing one of the alerts explained below</li></ul><blockquote><p><strong>Verified: </strong>This means that the QR is genuine. The particular Participant will be logged on the attendance, showing the NAME, EMAIL, PHONE NUMBER and Arrival Time.</p><p><strong>Already USED: </strong>This means that the QR is genuine <strong>BUT</strong> has already been used by a participant. This participant would not be logged on the attendance.</p><p><strong>NOTE: Same Qr is never &nbsp;generated for two users.</strong></p><p><strong>Invalid: </strong>This means that the QR is either not created by Boardspeck or Not created for the particular Event. This participant would not be logged on the attendance.</p></blockquote><ul><li>The list of verified participants is generated below the scanner as you verify more participants. This also serves as attendance for the event.</li><li>To get all Numbers of Verified Participants (Click <strong>All Numbers</strong>)</li><li>To get all Emails of Verified Participants (Click <strong>All Email</strong>)</li><li>To Export the Attendance (Click <strong>Export Verified Attendance</strong>)</li><li>&nbsp;</li></ul><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-event-on-boardspeck-free&amp;id=1540815466nse4811613wo91wh7\"><strong>How to post and promote your event on Boardspeck (FREE)&nbsp;</strong></a></p><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=how-to-manage-the-registered-participants-for-your-event-on-boardspeck-free&amp;id=1540818504n7344we63h9s0w12o\"><strong>How to Manage the Registered Participants for your Event on Boardspeck (FREE)&nbsp;</strong></a></p><p>&nbsp;</p>', 'uploads/1540820615762339820181026_104849_0001.png', 'j90819542aBn72i', '13:43:37', '2018-10-29', '15408206176n1r1176e43qs0w3', 'thumb/15408206156705120181026_104849_0001.png', 1),
(8, 'Boardspeck Customized  Links (Readable and Memorable)', 'Boardspeck', 'show', '7398irnA16fc538a4', '<p>Customized links makes it easy for you to navigate to your contents and share your URL easily to other people. Customized links features are available for each <strong>Event </strong>and <strong>Training</strong> posted on Boardspeck. This article will give insight on the various &nbsp;shortlink URL and the page that can be accessed with it.</p><h3><strong>Event:</strong></h3><p>When you post your event on Boardspeck, you are required to enter a <strong>UNIQUENAME</strong> &nbsp; for the particular event.&nbsp;</p><p>The following link can be used to access your event.</p><blockquote><p><strong>https://boardspeck.com/e/UNIQUENAME </strong>will lead to the event on Boardspeck.</p><p><strong>https://boardspeck.com/pic/UNIQUENAME </strong>can be used to customize an image by people who like to attend your event</p></blockquote><p>[Optional] If you enable <strong>Participants Registration :</strong></p><blockquote><p><strong>https://boardspeck.com/c/UNIQUENAME</strong> is your registration link. People can register for your event through this link.</p></blockquote><p>&nbsp;</p><p>&nbsp;</p><h3><strong>Training:</strong></h3><p>When you post your training on Boardspeck, you are required to enter a <strong>UNIQUENAME</strong> &nbsp;for your training. This purpose of the unique name is to customize your URL for the particular training.&nbsp;</p><p>The following link can be used to access your training.</p><blockquote><p><strong>https://boardspeck.com/t/UNIQUENAME </strong>will lead to the training on Boardspeck.</p></blockquote><p>[Optional] If you enable <strong>Participants Registration :</strong></p><blockquote><p><strong>https://boardspeck.com/r/UNIQUENAME</strong> is your registration link. People can register for your training through this link.</p></blockquote><p>Visit to learn <a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-event-on-boardspeck-free&amp;id=1540815466nse4811613wo91wh7\"><strong>How to post and promote your event on Boardspeck (FREE)&nbsp;</strong></a></p><p>Visit to learn<a href=\"https://boardspeck.com/blog?post=how-to-post-and-promote-your-training-on-boardspeck-free&amp;id=1540738711ne6s15h266o818ww\"><strong> How to post and promote your training on Boardspeck (FREE)&nbsp;</strong></a></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'uploads/15414938361683089shortlink.png', 'j90819542aBn72i', '08:43:58', '2018-11-06', '1541493838ed4r4a13e75b6k3ws02sonpc', 'thumb/15414938369561077shortlink.png', 1),
(9, 'How to Overcome Writerâ€™s Block: 14 Tricks That Work', 'JEFF GOINS', 'show', '8a8ol2G34157b07l', '<blockquote><p><i>Writing about a writerâ€™s block is better than not writing at all.</i><br><strong>â€“Charles Bukowski</strong></p></blockquote><p>It happens to every writer. Itâ€™s inevitable. Your prose has turned to mush, you donâ€™t have a creative bone left in your body, and you want to throw in the towel.&nbsp;</p><p>Writerâ€™s block. Every writer struggles with it. But what you <i>do</i> with it is what really matters. Before we talk about solutions, though, letâ€™s talk about the problem.</p><h3>Common causes of writerâ€™s block</h3><p>The reasons for your block may vary, but some common ones include:</p><ul><li><strong>Timing: </strong>Itâ€™s simply not the right time to write. Your ideas may need to stew a little longer before writing them down.</li><li><strong>Fear:</strong> Many writers struggle with being afraid, with putting their ideas (and themselves) out there for everyone to see and critique. <a href=\"https://www.copyblogger.com/writers-block/\">Fear</a> is a major reason some writers never become writers.</li><li><strong>Perfectionism:</strong> You want everything to be <i>just right</i> before you ever put pen to paper or touch a keyboard. You try to get it <a href=\"https://goinswriter.com/overcoming-perfectionism/\">perfect</a> in your head and never do, so you never begin.&nbsp;To help you through this, we created <a href=\"https://www.donthitpublish.com/\">Donâ€™t Hit Publish.</a> Itâ€™s a free tool that tells you if your blog post is good enough to publish and also give you tips on how to improve it.</li></ul><h3>So how do we vanquish this enemy?</h3><p>Itâ€™s a tough question to answer, and Iâ€™m afraid I donâ€™t have a great solution.&nbsp;Iâ€™ve wrestled with writerâ€™s block on many occasions, and each victory looked different.</p><p>Thatâ€™s the thing about writing: itâ€™s an art, not a science. And youâ€™ll have to approach it as such.&nbsp;There is no formulaic fix, no â€œ7 Steps to Becoming a Better Writer Now.â€</p><p>Except one.&nbsp;But you already know what it is:&nbsp;Start hacking away. Begin trying stuff. Sometimes, the quirkier, the <i>better</i>. The trick is find something that works for you.</p><h3>Creative solutions to writerâ€™s block</h3><p>Here are a few ideas to help you work through your creative constipation:</p><ol><li>Go for a walk.</li><li>Eliminate distractions (I use <a href=\"https://www.ommwriter.com/\">Ommwriter</a> to focus on just writing).</li><li>Do something to get your blood flowing. (I like running.)</li><li>Play. (My personal preference is LEGOS.)</li><li>Change your environment.</li><li>Read a book.</li><li><a href=\"https://www.wikihow.com/Freewrite\">Freewrite</a>.</li><li>Listen to music (try classical or jazz to mix it up).</li><li>Brew some coffee (my personal favorite).</li><li>Create a routine. Many famous writers have <a href=\"https://dailyroutines.typepad.com/\">daily routines</a> to summon the Muse.</li><li>Spend time with someone who makes you feel good.</li><li>Call an old friend.</li><li>Brainstorm ideas in bullet points.</li><li>Read some <a href=\"https://www.copyblogger.com/quotations-for-bloggers/\">inspiring quotes</a> to get you started.</li><li>The possibilities are endless, but movement is critical. You need to generate momentum to get out of your funk.</li></ol><p>Once you start heading in a direction, itâ€™s easier to pick up speed. And before you know it, your block will be a distant memory and youâ€™ll be doing what you once thought impossible. Youâ€™ll be <i>writing</i>.</p><h3>How to <i>not</i> overcome writerâ€™s block</h3><p>And just for fun, here are some anti-solutions to this problem:</p><ol><li>You do not overcome writerâ€™s block by refusing to write until you feel â€œ<a href=\"https://goinswriter.com/does-inspiration-exist/\">inspired</a>.â€</li><li>You do not overcome writerâ€™s block by wallowing in self-pity.</li><li>You do not overcome writerâ€™s block by <a href=\"https://goinswriter.com/reverse-procrastination/\">procrastinating</a> or making <a href=\"https://goinswriter.com/you-have-no-excuse/\">excuses</a>.</li><li>You do not overcome writerâ€™s block by watching TV.</li><li>You do not overcome writerâ€™s block by reading articles on how to overcome writerâ€™s block. (Kinda shot myself in the foot there, huh?)</li></ol><h3>The fail-proof solution</h3><p>If youâ€™re <i>still</i> not satisfied, you have one last resort, an ace up your sleeve. The silver bullet solution.&nbsp;The fail-proof way to overcome writerâ€™s block is one you already know. In fact, youâ€™ve been avoiding it this whole time, because itâ€™s precisely what you <i>donâ€™t</i>want to hear.</p><blockquote><p><strong>You overcome writerâ€™s block by </strong><i><strong>writing</strong></i><strong>.</strong> (<a href=\"https://ctt.ec/XN141\">Tweet</a>)</p></blockquote><p>Start somewhere, anywhere. Write a few lines. <i>Say anything.</i> And see what happens.&nbsp;Donâ€™t think about it too much or make any fancy announcements. Just <i>write</i>. It doesnâ€™t need to be eloquent or presentable; it just needs to be written..</p><p>Write for the joy of writing. Because you canâ€™t <i>not</i> do it. Donâ€™t try to say or produce anything; just get some words on paper, now.&nbsp;No excuses or justifications.</p><p>You <i>can</i> write. Donâ€™t make it harder than it has to be. Just type a few words. They donâ€™t have to be good (<i>all</i>first drafts suck). It just has to be written. Then you have something to work it. You can tweak from there.</p><p>If you do this, youâ€™ll get past the hump. I promise. The difference between professional writers and amateurs is this: Both encounter blocks, but one pushes through while the other gets paralyzed.</p><p>You <i>can</i> do this. Just write.</p><p>(One caveat: This technique <i>only</i> works if youâ€™re truly blocked and not â€œempty,â€ which is an entirely <a href=\"https://goinswriter.com/when-youre-feeling-uninspired\">different matter</a>altogether.)</p><blockquote><p>If you need some help getting started with a daily writing habit, I encourage you to join my 31-day writing challenge. Itâ€™s free! <a href=\"https://my.leadpages.net/leadbox/1441bd773f72a2%3A1245e56aeb46dc/5741384237580288/\">Click here to get started.</a></p></blockquote>', 'uploads/15549810517728081writers-block.jpg', 'j90819542aBn72i', '11:10:53', '2019-04-11', '15549810532ieh4o778w72a19rtc4l', 'thumb/15549810519572374writers-block.jpg', 1);
