to join us in celebrating the love and commitment of Samantha and Jack as they embark on this new chapter of their lives together. Mark your calendars and get ready to witness the beginning of a beautiful journey. More details to follow soon!', 'a:3:{i:72311678974512;a:2:{s:5:\"image\";N;s:5:\"thumb\";N;}i:27521678974533;a:2:{s:5:\"image\";N;s:5:\"thumb\";N;}i:13621678974543;a:2:{s:5:\"image\";N;s:5:\"thumb\";N;}}', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', NULL, NULL, NULL, NULL, NULL, NULL, '2023-03-31', NULL, 'a:2:{s:20:\"SmFjayBTbWl0aC9hbGw=\";a:5:{s:2:\"id\";s:20:\"SmFjayBTbWl0aC9hbGw=\";s:6:\"couple\";s:10:\"Jack Smith\";s:11:\"designation\";s:5:\"Groom\";s:8:\"guestdes\";s:20:\"<p>Jack is a man</p>\";s:4:\"blob\";s:30016:\"\";}s:24:\"U2FtYW50aGEgTGVlL2FsbA==\";a:5:{s:2:\"id\";s:24:\"U2FtYW50aGEgTGVlL2FsbA==\";s:6:\"couple\";s:12:\"Samantha Lee\";s:11:\"designation\";s:5:\"Bride\";s:8:\"guestdes\";s:26:\"<p>Samantha is a lady.</p>\";s:4:\"blob\";s:26384:\"\";}}', '#003261', '1', NULL, 'NGN', NULL);
