(18, 'Demo Bride', 'Demo Groom', 'demo_wedding', '2024-06-19', 'WED_17187953006d8456e89womed929', '11:08:20', 'hide', NULL, NULL, NULL, '<p>Test</p>', NULL, '1578967308_1647432', 'uploads/6429590WhatsApp_Image_2024-02-23_at_16.14.27_f1670d50.jpg', NULL, NULL, NULL, NULL, NULL, '2024-06-30', NULL, NULL, NULL, NULL, NULL, 'NGN', 'thumb/560857thumb1718795300.jpg'),
(19, 'Dupe', 'Shol', 'dupe_shola_2024', '2024-06-19', 'WED_1718797436ddw4766u6e6875ep5', '11:43:56', 'hide', NULL, NULL, NULL, '<p><strong>Wedding of Dupe and Shola</strong></p><p>Join us in celebrating the joyous union of Dupe and Shola on Saturday, July 30, 2024, at the picturesque Whispering Pines Estate.</p><p><strong>Ceremony</strong></p><p>The ceremony will commence at 4:00 PM in the blooming Rose Garden, surrounded by a canopy of ancient oaks and vibrant seasonal flowers. Guests will be serenaded by a live string quartet, creating an atmosphere of romance and elegance as Dupe and Shola exchange their heartfelt vows under a beautifully adorned floral arch.</p><p><strong>Reception</strong></p><p>Following the ceremony, guests are invited to the Grand Pavilion for a cocktail hour featuring signature drinks and gourmet hors d\'oeuvres. The reception will begin at 6:00 PM, with a delectable three-course dinner crafted by Chef Marcus Taylor. The menu will feature a variety of options, including vegetarian and gluten-free dishes, ensuring a delightful culinary experience for all.</p><p><strong>Entertainment</strong></p><p>After dinner, the evening will come alive with music and dancing. The talented band, The Silver Notes, will perform a mix of classic hits and modern favorites, ensuring that the dance floor remains vibrant and lively. A photo booth with fun props will be available to capture joyful memories.</p><p><strong>Special Touches</strong></p><p>Dupe and Shola have curated a selection of their favorite wines and crafted a dessert bar featuring a variety of sweets, including a towering wedding cake, cupcakes, and a chocolate fountain. Each guest will receive a personalized wedding favor as a token of appreciation for sharing in this special day.</p><p><strong>Attire</strong></p><p>Guests are kindly requested to adhere to the formal attire dress code. Ladies are encouraged to wear elegant dresses or gowns, while gentlemen are asked to wear suits or tuxedos.</p><p><strong>Accommodations</strong></p><p>For the convenience of out-of-town guests, a block of rooms has been reserved at the nearby Pine Valley Resort. Shuttle services will be provided to and from the wedding venue.</p><p><strong>RSVP</strong></p><p>Please RSVP by June 20, 2024, through our wedding website, where you can also find additional details about the event, travel arrangements, and gift registry.</p><p>We look forward to celebrating this beautiful day with you!</p><p>With love, Dupe &amp; Shola</p>', 'a:2:{i:45091718798224;a:2:{s:5:\"image\";s:40:\"uploads/171879822474013wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/8825907thumb1718798224.jpg\";}i:67851718798234;a:2:{s:5:\"image\";s:40:\"uploads/171879823440558wedding_image.jpg\";s:5:\"thumb\";s:32:\"thumb/4109549thumb1718798234.jpg\";}}', '1578967308_1647432', 'uploads/483526wedding.jpeg', NULL, NULL, NULL, NULL, NULL, '2024-06-30', NULL, 'a:2:{s:12:\"RHVwZS9hbGw=\";a:5:{s:2:\"id\";s:12:\"RHVwZS9hbGw=\";s:6:\"couple\";s:4:\"Dupe\";s:11:\"designation\";s:5:\"Bride\";s:8:\"guestdes\";s:3127:\"<p><strong>Dupe\'s Journey to Love</strong></p><p>In the heart of a bustling city, there lived a young woman named Dupe. From a tender age, Dupe\'s spirit shone brightly, her laughter echoing through the narrow streets and her kindness touching the hearts of everyone she met. She was known for her generous heart, always ready to help a friend in need or bring a smile to a stranger\'s face.</p><p>Dupe\'s life was filled with love from her family and friends, but deep down, she yearned for a soulmate, someone who would understand her completely and cherish her endlessly. She believed in the magic of love stories, often losing herself in books and movies that depicted the beautiful journey of finding one\'s true love.</p><p>One sunny afternoon, Dupe decided to take a stroll through the local park. The park was her sanctuary, a place where she could unwind and dream. As she walked along the path, she noticed a man sitting on a bench, deeply engrossed in a sketchbook. His concentration was so intense that he didn’t notice Dupe approaching.</p><p>Curiosity piqued, Dupe sat on a nearby bench and watched as the man’s pencil danced across the paper, creating intricate designs and beautiful portraits. Intrigued by his talent and the peaceful expression on his face, Dupe couldn’t resist striking up a conversation. \"Your drawings are incredible,\" she said with a warm smile.</p><p>The man looked up, slightly surprised but pleasantly so. \"Thank you,\" he replied. \"I\'m Shola.\"</p><p>From that moment, a beautiful friendship blossomed between Dupe and Shola. They spent countless afternoons together in the park, talking about their dreams, passions, and everything in between. Dupe discovered that Shola was not only a talented artist but also a kind soul with a heart as big as hers.</p><p>As the seasons changed, so did their feelings for each other. What started as a simple friendship grew into a deep and abiding love. Shola admired Dupe\'s unwavering positivity and her ability to find beauty in the simplest of things. Dupe was captivated by Shola\'s creativity and his gentle nature.</p><p>One evening, under the twinkling stars and the soft glow of fairy lights, Shola took Dupe\'s hand and led her to their favorite spot in the park. There, surrounded by the beauty of nature and the memories they had created, he knelt down on one knee and asked her to be his forever.</p><p>With tears of joy streaming down her face, Dupe said yes, her heart overflowing with happiness. She had found her soulmate, the one who understood her completely and cherished her endlessly.</p><p>Their wedding day was a celebration of their love story, a story that began with a simple stroll in the park and blossomed into a lifetime of happiness. As Dupe walked down the aisle towards Shola, she couldn’t help but feel grateful for every moment that led her to this day.</p><p>Surrounded by family and friends, Dupe and Shola promised to love and cherish each other for the rest of their lives. Their journey was a testament to the magic of love and the beautiful stories that unfold when two hearts find their perfect match.</p>\";s:5:\"image\";s:37:\"uploads/171879784756702base_image.jpg\";}s:12:\"U2hvbGEvYWxs\";a:5:{s:2:\"id\";s:12:\"U2hvbGEvYWxs\";s:6:\"couple\";s:5:\"Shola\";s:11:\"designation\";s:5:\"Groom\";s:8:\"guestdes\";s:3414:\"<p><strong>Shola\'s Path to True Love</strong></p><p>In the lively city of Lagos, a young man named Shola lived a life filled with passion and creativity. From a young age, Shola had an extraordinary talent for drawing, his sketches capturing the vibrant essence of the world around him. He often spent hours at a time in the bustling city parks, letting the beauty of nature and the rhythm of the city inspire his work.</p><p>Despite his talent and the admiration he received, Shola\'s heart held a quiet yearning. He was content with his art, but he longed for someone with whom he could share his dreams and joys, someone who would see the world as beautifully as he did.</p><p>One fateful afternoon, as the sun cast a warm golden hue over the park, Shola settled on his favorite bench, sketchbook in hand. Immersed in his drawing, he barely noticed the gentle rustle of leaves or the laughter of children playing nearby. His focus was interrupted by a soft voice that seemed to blend seamlessly with the serene ambiance.</p><p>\"Your drawings are incredible,\" the voice said, filled with genuine admiration.</p><p>Startled, Shola looked up to see a young woman with a radiant smile standing nearby. Her eyes sparkled with curiosity and kindness. \"Thank you,\" he replied, his voice carrying a hint of surprise. \"I\'m Shola.\"</p><p>The woman introduced herself as Dupe, and from that moment, a connection sparked between them. They spent the rest of the afternoon talking about their passions and dreams, discovering a shared love for the simple joys of life. Shola found himself captivated by Dupe\'s unwavering positivity and the way she saw beauty in the smallest things.</p><p>As the days turned into weeks and then months, Shola and Dupe\'s bond grew stronger. They would meet regularly in the park, Shola sketching while Dupe shared stories that painted vivid pictures in his mind. Shola cherished these moments, feeling his heart fill with a warmth he had never known before.</p><p>One evening, under the canopy of a starlit sky, Shola decided to express the depth of his feelings. He took Dupe to their favorite spot in the park, where the scent of blooming flowers mingled with the cool night air. With a heart full of love and hope, Shola knelt down on one knee, his hand gently holding Dupe\'s.</p><p>\"Dupe,\" he began, his voice steady and sincere, \"you\'ve brought so much light and joy into my life. Will you marry me and make my world complete?\"</p><p>Tears of happiness welled up in Dupe\'s eyes as she nodded, her voice choked with emotion. \"Yes, Shola, a thousand times yes.\"</p><p>Their engagement was a promise of a beautiful future together, a future filled with love, laughter, and shared dreams. Shola knew that he had found his soulmate, the one who saw the world as beautifully as he did and made every moment magical.</p><p>On their wedding day, Shola stood at the altar, his heart brimming with happiness as he watched Dupe walk down the aisle. Surrounded by their loved ones, they exchanged vows, pledging to love and support each other for the rest of their lives.</p><p>Shola\'s journey to finding true love had been filled with unexpected moments and beautiful surprises. He had found not just a partner, but a kindred spirit in Dupe. Together, they embarked on a new chapter of their lives, their love story a testament to the magic that happens when two hearts find their perfect match.</p>\";s:5:\"image\";s:37:\"uploads/171879810110629base_image.jpg\";}}', '#541e80', NULL, NULL, 'NGN', 'thumb/5177786thumb1718797436.jpg'),
