(22, '1541980143etr5el69ra7519i1ha9sc', '36au8m1elEn53m8538', '15409061695snaoeu694w89l7304u', '<p>Hello Mr Ejire,<br><br>I read your poem well and think it\'s a really nice one with a sensible message amidst its lines, but please endeavour to not add emojis to the title of the work your made, it really the work annoying and even if you can, do not make use of it in the work at all.<br><br>It\'s supposed to be carried out with IMAGERY (if you understand me)<br><br>Thanks, I will be expecting your critique on any of my work as well, thanks.<br><br><i>P.S: I would like to connect with you on social media, so please try to leave your handles.</i></p><p>&nbsp;</p><p>&nbsp;</p>', 2, '2018-11-16'),
(23, '15362498509m6iil9c52t696-r0ea3', 'e238t723ts7106', 'j90819542aBn72i', '<p>This work is dope and good</p>', 2, '2018-11-30'),
(24, '154288445743tit22al0r6eech596', 'j90819542aBn72i', '36au8m1elEn53m8538', '<p>Reading this for the first time...I feel the sense of the message you try to pass...</p><p>&nbsp;</p><p>That\'s the legs of the violator were faster than the victim...Depicts alot...Could mean that he is stronger than the victim and could also mean that here is no agreement.&nbsp;</p><p>Pushing against the wall speaks violence and brutality...The most powerful part of this work is the last part...the aftermath of the so called violators enjoyment and lack of empathy or consideration to the victim...You have done justice to this one.... Mmmm</p><p>&nbsp;</p><p>Nice slight Oxymoronic Painful Moan of Pleasure</p><p>&nbsp;</p><p>Personification of the hormone that says yes and no. Kudos</p>', 1, '2018-12-01'),
(25, '1543759240i0ehl973rt0c75tae68', '36au8m1elEn53m8538', 'jy95Ae4d739i4o02', 'This is really captivating Mr AYO.\r\n\r\nKeep up the good work, it\'s didactic and fun to read!', 2, '2018-12-02'),
